const testFileTree = {
  assets: {
    _name: "assets",
    images: {
      _name: "images",
      "logo.png": { _name: "logo.png" },
      "avatar.jpg": { _name: "avatar.jpg" },
    },
  },
  "index.js": { _name: "index.js" },
};

export default testFileTree;
